pragma solidity >=0.5.0 <0.8.0;

contract Struct{

struct Emp{
    string name;
    uint age;
    address acc;
}

Emp public emp;

Emp[] public emps;

function setvalues() public {

 Emp memory emp1= Emp(" Krishna", 20, msg.sender);

 Emp memory emp2= Emp( {name:"Radhika", age:18, acc:msg.sender});

  Emp memory emp3;
 emp3.name= " Balaram";
 emp3.age=26;
 emp3.acc= msg.sender; // not use this on contract level

 emps.push(emp1);
 emps.push (emp2);


 }

}
